data.SUGESTÃO_TECNICO:
Prezados/as, seria interessante se os seguinte itens encontrassem espaço explícito no PDI institucional: 
(1) a regulamentação e implementação do PGD no âmbito da UFPA;
(2) A melhoria da infraestrutura tecnológica institucional;
(3) A valorização e a promoção das ações de educação a distância no âmbito da UFPA para a formação de cidadãos e profissionais, sobretudo nas áreas interioranas.

Identificar práticas que garantam equidade na distribuição orçamentária;
Implantação de processos de indicação de gestores com base em habilidades e competências;
Implantação de processos que garantam o respeito e o não assédio em todos os níveis, além do processo educativo;
Implantação de processos/programas que estimulem a geração de ideias de modernização das ações e da infraestrutura física;
Implantação de projetos que garantam espaços realmente sustentáveis no Campus e nos Campi

Sugiro que seja dada maior atenção às questões de assédio moral na instituição;.
Em relação à segurança, há sérias deficiências no período noturno devido ao número reduzido de seguranças;
Sugiro também a oferta de mais cursos de capacitação;
A estrutura física da minha unidade de trabalho precisa de mais atenção. A Biblioteca Central, em particular, necessita de mais espaço para acomodar o crescimento dos acervos pessoais e históricos. Além disso, é fundamental um espaço maior para atender às demandas do MEC no quesito convivência dos usuários.

Algumas sugestões para o incremento das ações de gestão, organização e planejamento na UFPA:
POLÍTICAS DE PESSOAL - Reforçar e promover seminários especializados de cargos e coordenadorias setoriais (como as Secretarias Executivas, Acadêmicas, CPGA's, Bibliotecas, Arquivos, pedagogos, técnicos em assuntos educacionais, psicólogos, entre outro), de forma a disseminar e compartilhar conhecimentos e vivências conjuntas, assim como atividades para as Gestões de Primeira Instância, Intermediárias e Superiores da Instituição;
POLÍTICAS DE PESSOAL - Promover ações de disseminação e divulgação de projetos e pesquisas promovidos por técnicos e docentes;
MISSÃO E PLANO DE DESENVOLVIMENTO INSTITUCIONAL / PLANEJAMENTO E AVALIAÇÃO: incluir a educação técnica, profissional e tecnológica e gestão e organização das unidades que lidam com essas ofertas de educação, além da arte e cultura, nos objetivos estratégicos no PDI da Universidade.
PLANEJAMENTO E AVALIAÇÃO / POLÍTICAS DE PESSOAL - Promover ações/visitas itinerantes dos órgãos da Administração Superior às Unidades que pertencem ao Campus Universitário de Belém, mas que não estão no bairro do Guamá (ex.: EMUFPA, ETDUFPA, EAUFPA, ICA, CMA, Museu, NMT, ICM, PPGArtes, Complexo dos Mercedários, entre outras), para maior integração regional da Universidade.

COMUNICAÇÃO COM A SOCIEDADE: elaborar materiais mais acessíveis ao nível de escolaridade e compreensão médio da população da região, para que possam alcançar com maior efetividade os planos e ações desenvolvidas;
ORGANIZAÇÃO E GESTÃO DA INSTITUIÇÃO: avançar na democracia interna, como: paridade nos órgãos colegiados, eleições com voto universal, eleições para escolha de dirigentes de unidades administrativas (ex: BC, CIAC, CEPS, Gráfica, etc), que servidoras(es) TAEs qualificadas(os) também possam se candidatar aos cargos eletivos dirigentes, pois não são inferiores aos servidores(as) docentes, entre outras medidas;
INFRAESTRUTURA FÍSICA: melhorar o meio ambiente laboral (ergonomia, equipamentos, sistemas e manual geral de protocolos operacionais padrão das tarefas administrativas), viabilizar refeições com valor mais acessível para servidoras(es) no RU, e valorizar as(os) trabalhadoras(es) terceirizadas(os), fiscalizar e cobrar das empresas que cumpram a legislação trabalhista, com carga horária e remuneração decente, e garantindo quantitativo suficiente de pessoal para atender as demandas de serviço de limpeza, segurança, transporte, alimentação, etc;
PLANEJAMENTO E AVALIAÇÃO: intensificar a divulgação dos instrumentos e de seus resultados
POLÍTICA DE PESSOAL: investir em espaços e políticas para a prática de esportes, atividades culturais e de lazer e espaços de convivência, a fim de promover o bem estar físico, mental e social de servidoras(es) TAEs e docentes;
